def clean_database
  FavouriteFarm.destroy_all
  ItemImage.destroy_all
  LineItem.destroy_all
  # CartItem.destroy_all
  Item.destroy_all
  Category.destroy_all
  Order.destroy_all
  Status.destroy_all
  DeliveryOption.destroy_all
  User.destroy_all
end

